import React from 'react'

import intLOGO from '../../assets/images/interactlogo.SVG'
import "Nav";

const LoginNav = () => {
  return (
    <React.Fragment>
    <div className="w-full overflow-hidden">
        <figure className='flex'>
          <a href='#'><img src={intLOGO} alt="" /></a>
        </figure>
    </div>
    </React.Fragment>
  )
}

export default LoginNav
